import React, { useState } from "react";
import InputField from "../Fields/Field.component";
import "./registrationForm.style.css";

const AddProductForm = () => {
  const [inputValue, setInputValue] = useState({ name: "", price: "" });
  const { name, price } = inputValue;

  const handleChange = (e) => {
    const { name, value } = e.target;
    setInputValue((prev) => ({
      ...prev,
      [name]: value,
    }));
    console.log(inputValue);
  };

  return (
    <form className="form-container">
      <div className="form-wrapper">
        <div className="form-header">
          <InputField
            type="text"
            value={name}
            placeholder=""
            label="Suffix"
            name="Suffix"
            className="suffix inputField"
            onChange={handleChange}
          />
          <InputField
            type="text"
            value={price}
            placeholder=""
            label="Title"
            name="Title"
            className="title inputField"
            onChange={handleChange}
          />
          <InputField
            type="text"
            value={name}
            placeholder=""
            label="Firstname"
            name="Firstname"
            className="firstname inputField"
            onChange={handleChange}
          />
          <InputField
            type="text"
            value={price}
            placeholder=""
            label="Lastname"
            name="Lastname"
            className="lastname inputField"
            onChange={handleChange}
          />
        </div>
        <div className="form-body">
          <InputField
            type="email"
            value={name}
            placeholder=""
            label="Email"
            name="Email"
            className="email inputField"
            onChange={handleChange}
          />
          <InputField
            type="text"
            value={price}
            placeholder=""
            label="Username"
            name="Title"
            className="username InputField"
            onChange={handleChange}
          />
        </div>
      </div>
    </form>
  );
};

export default AddProductForm;
